    it('Shold load the home page', () => {
        App.openHomePage()
    })

    it('Test links in the Navbar', () => {
        Navbar.clickAboutLink()
        Navbar.clickClientsLink()
        Navbar.clickSpecialtiesLink()
        Navbar.clickHomeLink()
        Navbar.clickContactLink()
    })

})

